import { Link } from "react-router-dom";

function Layout(props) {
  const {currentUser, handleLogout} = props
  return (
    <div>
      <nav>
        <Link to='/'>
        <p>The Book Nook</p>
        </Link>
        <Link to="/login">Log In</Link>
        <Link to="/signup">Sign Up</Link>
      </nav>
      <div>{props.children}</div>
      <footer></footer>
    </div>
  );
}

export default Layout;
